  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kodiak NWR outlines
  Refuge accomplishments from September through December of 1953. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, and mammals- is also covered. The Refuge development and maintenance section
  discusses physical developments. Resource management is outlined; topics include
  permits. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes Refuge visitors,
  Refuge participation, hunting, and fishing. Items of interest and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
